using DogApi.Helpers.ExtensionMethods;

namespace DogApi.Models
{
    public class Profile
    {
        private static List<string> descriptions = new List<string>()
        {
            "Jag är en ståtlig hund på 10 vårar.",
            "Jag HATAR barn!!! Men gillar andra hundar ;P",
            "Söker en partner som vill träffas och bli kära",
            "Jag gillar banan"
        };

        private static List<string> statuses = new List<string>()
        {
            "Hos veterinären =(",
            "Tränar agility",
            "Sover",
            "Ute och leker",
            "Swag ;P"
        };

        private static List<string> images = new List<string>()
        {
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ2Hlf1oFrlu5lbDmE68voVG0x9qEnQF7iTUw&usqp=CAU",
            "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRHylmEMCVzfjwwKAWaWMj3Ncs2EjtLAa9Oiw&usqp=CAU",
            "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTA_pu68R09wYhs2ITuSEalmq5RggXOzrXM1g&usqp=CAU"
        };

        public string Description { get; set; }
        public string Status { get; set; }
        public string Image { get; set; }

        internal static Profile CreateRandom(Random random)
        {
            return new Profile()
            {
                Description = descriptions.GetRandom(random),
                Image = images.GetRandom(random),
                Status = statuses.GetRandom(random)
            };
        }
    }
}
